import React from 'react';
import '../Style/Tournoi.css';

const Tournoi = ({ tournois }) => {
    return (
        <div className="tournoisContainer">
            {tournois.map((tournoi, index) => (
                <div key={index} className="tournoi">
                    <h3>Tournoi {tournoi.categorie}</h3>
                    <p>Date: {tournoi.date}</p>
                </div>
            ))}
        </div>
    );
};

export default Tournoi;
